import React from 'react';
import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, ListGroupItem } from 'reactstrap';

export default class Example extends React.Component {

  constructor (props){
    super(props);
    this.state={
      playlist: [],
      isloaded: false,

    }
  }

  componentDidMount(){
    fetch('https://se3309-final-project-amali28.c9users.io:8081/api/playlistss')
    .then(res=> res.json())
    .then(json => {

   this.setState({
        isloaded: true,
        playlist: json,
      })
    });

  console.log("hi from");
  }


  render() {
    var{isloaded, playlist} = this.state;

    return (

      <Form>
        <Row form>
          <Col md={6}>
            <FormGroup>
              <Label for="Playlist">Create a Playlist</Label>
             <ul>
              {playlist.map(playlists => (
          	<p> {playlists.id} </p>
            ))}
              </ul>
              <Input type="text" name="Playlist" id="exampleEmail" placeholder="Enter playlist name..." />
            </FormGroup>
          </Col>
        </Row>
        <ListGroup stylename= "songNames">

          <ListGroupItem tag="button" action>Song 1</ListGroupItem>
          <ListGroupItem tag="button" action>Song 2</ListGroupItem>
          <ListGroupItem tag="button" action>Song 3</ListGroupItem>
          <ListGroupItem tag="button" action>Song 4</ListGroupItem>
          <ListGroupItem tag="button" action>Song 5</ListGroupItem>
        </ListGroup>
        <Button id="createPlaylist">Create</Button>
      </Form>
    );



  }
  retrieveSongs() {

  }
}
